import React from 'react'
import Navbarpanel from './Navbarpanel';
import { Outlet } from 'react-router-dom';
import { Provider } from 'react-redux';
import { store } from './store'
const Routelayout = () => {
    return (
        <>
            <Provider store={store}>
                <Navbarpanel />
                <main>
                    <Outlet />
                </main>
            </Provider>

        </>
    )
}

export default Routelayout
